---
graphs:
- nodes:
  - id: "http://purl.obolibrary.org/obo/RO_0002170"
    meta:
      definition:
        val: "a is connected to b if and only if a and b are discrete structure, and\
          \ there exists some connecting structure c, such that c connects a and b"
        xrefs: []
    type: "PROPERTY"
    lbl: "connected to"
  - id: "http://purl.obolibrary.org/obo/RO_0002291"
    meta:
      definition:
        val: "x is ubiquitously expressed in y if and only if x is expressed in y,\
          \ and the majority of cells in y express x"
        xrefs: []
    type: "PROPERTY"
    lbl: "ubiquitously expressed in"
  - id: "http://purl.obolibrary.org/obo/RO_0002292"
    meta:
      definition:
        val: "Inverse of 'expressed in'"
        xrefs: []
    type: "PROPERTY"
    lbl: "expresses"
  - id: "http://purl.obolibrary.org/obo/RO_0002171"
    meta:
      definition:
        val: "A is mutually_spatially_disjoint_with B if both A and B are classes,\
          \ and there exists no p such that p is part_of some A and p is part_of some\
          \ B."
        xrefs: []
    type: "PROPERTY"
    lbl: "mutually spatially disjoint with"
  - id: "http://purl.obolibrary.org/obo/RO_0002176"
    meta:
      definition:
        val: "c connects a if and only if there exist some b such that a and b are\
          \ similar parts of the same system, and c connects b, specifically, c connects\
          \ a with b. When one structure connects two others it unites some aspect\
          \ of the function or role they play within the system."
        xrefs: []
    type: "PROPERTY"
    lbl: "connects"
  - id: "http://purl.obolibrary.org/obo/RO_0002297"
    type: "PROPERTY"
    lbl: "results in formation of"
  - id: "http://purl.obolibrary.org/obo/RO_0002177"
    meta:
      definition:
        val: "a is attached to part of b if a is attached to b, or a is attached to\
          \ some p, where p is part of b."
        xrefs: []
    type: "PROPERTY"
    lbl: "attached to part of"
  - id: "http://purl.obolibrary.org/obo/RO_0002298"
    meta:
      definition:
        val: "The relationship that links an entity with the process that results\
          \ in the formation and shaping of that entity over time from an immature\
          \ to a mature state."
        xrefs: []
    type: "PROPERTY"
    lbl: "results in morphogenesis of"
  - id: "http://purl.obolibrary.org/obo/RO_0002299"
    meta:
      definition:
        val: "The relationship that links an entity with a process that results in\
          \ the progression of the entity over time that is independent of changes\
          \ in it's shape and results in an end point state of that entity."
        xrefs: []
    type: "PROPERTY"
    lbl: "results in maturation of"
  - id: "http://purl.obolibrary.org/obo/RO_0002178"
    meta:
      definition:
        val: "Relation between an arterial structure and another structure, where\
          \ the arterial structure acts as a conduit channeling fluid, substance or\
          \ energy."
        xrefs: []
    type: "PROPERTY"
    lbl: "supplies"
  - id: "http://purl.obolibrary.org/obo/RO_0002179"
    meta:
      definition:
        val: "Relation between an collecting structure and another structure, where\
          \ the collecting structure acts as a conduit channeling fluid, substance\
          \ or energy away from the other structure."
        xrefs: []
    type: "PROPERTY"
    lbl: "drains"
  - id: "http://purl.obolibrary.org/obo/RO_0002293"
    meta:
      definition:
        val: "inverse of ubiquiotously expressed in"
        xrefs: []
      subsets:
      - "http://purl.obolibrary.org/obo/RO_0002259"
    type: "PROPERTY"
    lbl: "ubiquitously expresses"
  - id: "http://purl.obolibrary.org/obo/RO_0002172"
    meta:
      definition:
        val: "An assertion that holds between an ontology class and an organism taxon\
          \ class, which is intepreted to yield some relationship between instances\
          \ of the ontology class and the taxon."
        xrefs: []
    type: "PROPERTY"
    lbl: "taxonomic class assertion"
  - id: "http://purl.obolibrary.org/obo/RO_0002173"
    meta:
      definition:
        val: "S ambiguous_for_taxon T if the class S does not have a clear referent\
          \ in taxon T. An example would be the class 'manual digit 1', which encompasses\
          \ a homology hypotheses that is accepted for some species (e.g. human and\
          \ mouse), but does not have a clear referent in Aves - the referent is dependent\
          \ on the hypothesis embraced, and also on the ontogenetic stage.  [PHENOSCPAE:asilomar_mtg]"
        xrefs: []
    type: "PROPERTY"
    lbl: "ambiguous for taxon"
  - id: "http://purl.obolibrary.org/obo/RO_0002295"
    meta:
      definition:
        val: "p results in the developmental progression of s iff p is a developmental\
          \ process and s is an anatomical structure and p causes s to undergo a change\
          \ in state at some point along its natural developmental cycle (this cycle\
          \ starts with its formation, through the mature structure, and ends with\
          \ its loss)."
        xrefs: []
    type: "PROPERTY"
    lbl: "results in developmental progression of"
  - id: "http://purl.obolibrary.org/obo/RO_0002174"
    meta:
      definition:
        val: "S dubious_for_taxon T if it is probably the case that no instances of\
          \ S can be found in any instance of T."
        xrefs: []
    type: "PROPERTY"
    lbl: "dubious for taxon"
  - id: "http://purl.obolibrary.org/obo/RO_0002175"
    meta:
      definition:
        val: "S present_in_taxon T if some instance of T has some S. This does not\
          \ means that all instances of T have an S - it may only be certain life\
          \ stages or sexes that have S"
        xrefs: []
    type: "PROPERTY"
    lbl: "present in taxon"
  - id: "http://purl.obolibrary.org/obo/RO_0002296"
    meta:
      definition:
        val: "p 'results in development of' c if and only if p is a developmental\
          \ process and p results in the state of c changing from its initial state\
          \ as a primordium or anlage through its mature state and to its final state."
        xrefs: []
    type: "PROPERTY"
    lbl: "results in development of"
  - id: "http://purl.obolibrary.org/obo/PATO_0000001"
    type: "CLASS"
    lbl: "quality"
  - id: "http://purl.obolibrary.org/obo/RO_0002160"
    meta:
      definition:
        val: "x only in taxon y if and only if x is in taxon y, and there is no other\
          \ organism z such that y!=z a and x is in taxon z."
        xrefs: []
    type: "PROPERTY"
    lbl: "only in taxon"
  - id: "http://purl.obolibrary.org/obo/RO_0002286"
    meta:
      definition:
        val: "Inverse of developmentally preceded by"
        xrefs: []
    type: "PROPERTY"
    lbl: "developmentally succeeded by"
  - id: "http://purl.obolibrary.org/obo/RO_0002287"
    type: "PROPERTY"
    lbl: "part of developmental precursor of"
  - id: "http://purl.obolibrary.org/obo/RO_0002161"
    meta:
      definition:
        val: "x never in taxon T if and only if T is a class, and x does not instantiate\
          \ the class expression \"in taxon some T\". Note that this is a shortcut\
          \ relation, and should be used as a hasValue restriction in OWL."
        xrefs: []
    type: "PROPERTY"
    lbl: "never in taxon"
  - id: "http://purl.obolibrary.org/obo/RO_0002162"
    meta:
      definition:
        val: "x is in taxon y if an only if y is an organism, and the relationship\
          \ between x and y is one of: part of (reflexive), developmentally preceded\
          \ by, derives from, secreted by, expressed."
        xrefs: []
      subsets:
      - "http://purl.obolibrary.org/obo/ro/subsets#ro-eco"
    type: "PROPERTY"
    lbl: "in taxon"
  - id: "http://purl.obolibrary.org/obo/RO_0002163"
    meta:
      definition:
        val: "A is spatially_disjoint_from B if and only if they have no parts in\
          \ common"
        xrefs: []
      subsets:
      - "http://purl.obolibrary.org/obo/ro/subsets#ro-eco"
    type: "PROPERTY"
    lbl: "spatially disjoint from"
  - id: "http://purl.obolibrary.org/obo/RO_0002285"
    meta:
      definition:
        val: "x developmentally replaces y if and only if there is some developmental\
          \ process that causes x to move or to cease to exist, and for the site that\
          \ was occupied by x to become occupied by y, where y either comes into existence\
          \ in this site or moves to this site from somewhere else"
        xrefs: []
    type: "PROPERTY"
    lbl: "developmentally replaces"
  - id: "http://purl.obolibrary.org/obo/RO_0002158"
    meta:
      definition:
        val: "two individual entities d1 and d2 stand in a shares_ancestor_with relation\
          \ if and only if there exists some a such that d1 derived_by_descent_from\
          \ a and d2 derived_by_descent_from a."
        xrefs: []
    type: "PROPERTY"
    lbl: "shares ancestor with"
  - id: "http://purl.obolibrary.org/obo/RO_0002159"
    type: "PROPERTY"
    lbl: "serially homologous to"
  - id: "http://purl.obolibrary.org/obo/RO_0000092"
    meta:
      definition:
        val: "inverse of has disposition"
        xrefs: []
      subsets:
      - "http://purl.obolibrary.org/obo/RO_0002259"
    type: "PROPERTY"
    lbl: "disposition of"
  - id: "http://purl.obolibrary.org/obo/RO_0000091"
    meta:
      definition:
        val: "a relation between an independent continuant (the bearer) and a disposition,\
          \ in which the disposition specifically depends on the bearer for its existence"
        xrefs: []
    type: "PROPERTY"
    lbl: "has disposition"
  - id: "http://purl.obolibrary.org/obo/RO_0003002"
    meta:
      definition:
        val: "Holds between protein a (a transcription factor) and DNA element b if\
          \ and only if a diminishes the process of transcription of b."
        xrefs: []
    type: "PROPERTY"
    lbl: "represses expression of"
  - id: "http://purl.obolibrary.org/obo/RO_0003001"
    meta:
      definition:
        val: "a produced_by b iff some process that occurs_in b has_output a."
        xrefs: []
      subsets:
      - "http://purl.obolibrary.org/obo/ro/subsets#ro-eco"
    type: "PROPERTY"
    lbl: "produced by"
  - id: "http://purl.obolibrary.org/obo/RO_0002156"
    meta:
      definition:
        val: "d derived_by_descent_from a if d is specified by some genetic program\
          \ that is sequence-inherited-from a genetic program that specifies a."
        xrefs: []
    type: "PROPERTY"
    lbl: "derived by descent from"
  - id: "http://purl.obolibrary.org/obo/RO_0002157"
    meta:
      definition:
        val: "inverse of derived by descent from"
        xrefs: []
      subsets:
      - "http://purl.obolibrary.org/obo/RO_0002259"
    type: "PROPERTY"
    lbl: "has derived by descendant"
  - id: "http://purl.obolibrary.org/obo/RO_0003003"
    meta:
      definition:
        val: "Holds between protein a (a transcription factor) and DNA element b if\
          \ and only if a activates the process of transcription of b."
        xrefs: []
    type: "PROPERTY"
    lbl: "increases expression of"
  - id: "http://purl.obolibrary.org/obo/RO_0002150"
    meta:
      definition:
        val: "X continuous_with Y if and only if X and Y share a fiat boundary."
        xrefs: []
    type: "PROPERTY"
    lbl: "continuous with"
  - id: "http://purl.obolibrary.org/obo/RO_0002151"
    meta:
      definition:
        val: "x partially overlaps y iff there exists some z such that z is part of\
          \ x and z is part of y, and it is also the case that neither x is part of\
          \ y or y is part of x"
        xrefs: []
      subsets:
      - "http://purl.obolibrary.org/obo/ro/subsets#ro-eco"
