    lbl: "partially overlaps"
  - id: "http://purl.obolibrary.org/obo/RO_0003000"
    meta:
      definition:
        val: "a produces b if some process that occurs_in a has_output b, where a\
          \ and b are material entities. Examples: hybridoma cell line produces monoclonal\
          \ antibody reagent; chondroblast produces avascular GAG-rich matrix."
        xrefs: []
      subsets:
      - "http://purl.obolibrary.org/obo/ro/subsets#ro-eco"
    type: "PROPERTY"
    lbl: "produces"
  - id: "http://purl.obolibrary.org/obo/PATO_0000141"
    type: "CLASS"
    lbl: "structure"
  - id: "http://purl.obolibrary.org/obo/IAO_0000412"
