  - id: "http://purl.obolibrary.org/obo/RO_0002380"
    meta:
      definition:
        val: "x is a branching part of y if and only if x is part of y and x is connected\
          \ directly or indirectly to the main stem of y"
        xrefs: []
      subsets:
      - "http://purl.obolibrary.org/obo/ro/subsets#ro-eco"
    type: "PROPERTY"
    lbl: "branching part of"
  - id: "http://purl.obolibrary.org/obo/RO_0000081"
    meta:
      definition:
        val: "a relation between a role and an independent continuant (the bearer),\
          \ in which the role specifically depends on the bearer for its existence"
        xrefs: []
    type: "PROPERTY"
    lbl: "role of"
  - id: "http://purl.obolibrary.org/obo/RO_0000080"
    meta:
      definition:
        val: "a relation between a quality and an independent continuant (the bearer),\
          \ in which the quality specifically depends on the bearer for its existence"
        xrefs: []
    type: "PROPERTY"
    lbl: "quality of"
  - id: "http://purl.obolibrary.org/obo/GO_0044456"
    type: "CLASS"
    lbl: "synapse part"
  - id: "http://purl.obolibrary.org/obo/RO_0000085"
    meta:
      definition:
        val: "a relation between an independent continuant (the bearer) and a function,\
          \ in which the function specifically depends on the bearer for its existence"
        xrefs: []
    type: "PROPERTY"
    lbl: "has function"
  - id: "http://purl.obolibrary.org/obo/RO_0002385"
    meta:
      definition:
        val: "x has potential to developmentrally contribute to y iff x developmentally\
          \ contributes to y or x is capable of developmentally contributing to y"
        xrefs: []
    type: "PROPERTY"
    lbl: "has potential to developmentally contribute to"
  - id: "http://purl.obolibrary.org/obo/RO_0002264"
    meta:
      definition:
        val: "c acts upstream of or within p if c is enables 'p' and p' causally upstream\
          \ of or within p"
        xrefs: []
      synonyms:
      - pred: "hasRelatedSynonym"
        val: "affects"
        xrefs: []
