    lbl: "has potential to developmentally induce"
  - id: "http://purl.obolibrary.org/obo/RO_0002387"
    meta:
      definition:
        val: "x has the potential to develop into y iff x develops into y or if x\
          \ is capable of developing into y"
        xrefs: []
