  - id: "http://purl.obolibrary.org/obo/RO_0002388"
    meta:
      definition:
        val: "x has potential to directly develop into y iff x directly develops into\
          \ y or x is capable of directly developing into y"
        xrefs: []
    type: "PROPERTY"
    lbl: "has potential to directly develop into"
  - id: "http://purl.obolibrary.org/obo/RO_0002381"
    meta:
      definition:
        val: "x main_stem_of y if y is a branching structure and x is a channel that\
          \ traces a linear path through y, such that x has higher capacity than any\
          \ other such path."
        xrefs: []
      subsets:
      - "http://purl.obolibrary.org/obo/ro/subsets#ro-eco"
    type: "PROPERTY"
    lbl: "main stem of"
  - id: "http://purl.obolibrary.org/obo/RO_0002260"
    meta:
      definition:
        val: "c has-biological-role r iff c has-role r and r is a biological role\
