    lbl: "has biological role"
  - id: "http://purl.obolibrary.org/obo/RO_0002382"
    meta:
      definition:
        val: "x proper_distributary_of y iff x distributary_of y and x does not flow\
          \ back into y"
        xrefs: []
      subsets:
      - "http://purl.obolibrary.org/obo/ro/subsets#ro-eco"
    type: "PROPERTY"
    lbl: "proper distributary of"
  - id: "http://purl.obolibrary.org/obo/RO_0002261"
    meta:
      definition:
        val: "c has-application-role r iff c has-role r and r is an application role\
          \ (CHEBI:33232)"
        xrefs: []
