      definition:
        val: "c has-chemical-role r iff c has-role r and r is a chemical role (CHEBI:51086)"
        xrefs: []
    type: "PROPERTY"
    lbl: "has chemical role"
  - id: "http://purl.obolibrary.org/obo/RO_0002383"
    meta:
      definition:
        val: "x proper_tributary_of y iff x tributary_of y and x does not originate\
          \ from y"
        xrefs: []
      subsets:
      - "http://purl.obolibrary.org/obo/ro/subsets#ro-eco"
    type: "PROPERTY"
    lbl: "proper tributary of"
  - id: "http://purl.obolibrary.org/obo/RO_0000087"
    meta:
      definition:
        val: "a relation between an independent continuant (the bearer) and a role,\
          \ in which the role specifically depends on the bearer for its existence"
        xrefs: []
    type: "PROPERTY"
    lbl: "has role"
  - id: "http://purl.obolibrary.org/obo/RO_0000086"
    meta:
      definition:
        val: "a relation between an independent continuant (the bearer) and a quality,\
          \ in which the quality specifically depends on the bearer for its existence"
        xrefs: []
    type: "PROPERTY"
    lbl: "has quality"
  - id: "http://purl.obolibrary.org/obo/RO_0002263"
