    type: "PROPERTY"
    lbl: "developmentally induces"
  - id: "http://purl.obolibrary.org/obo/RO_0002258"
    meta:
      definition:
        val: "Candidate definition: x developmentally related to y if and only if\
          \ there exists some developmental process (GO:0032502) p such that x and\
          \ y both participates in p, and x is the output of p and y is the input\
          \ of p"
        xrefs: []
