    meta:
      definition:
        val: "An assertion that holds between an OWL Object Property and a temporal\
          \ interpretation that elucidates how OWL Class Axioms that use this property\
          \ are to be interpreted in a temporal context."
        xrefs: []
    type: "PROPERTY"
    lbl: "temporal interpretation"
  - id: "http://purl.obolibrary.org/obo/RO_0001901"
    meta:
      definition:
        val: "\n\n## Elucidation\n\nThis is used when the statement/axiom is assumed\
          \ to hold true 'eternally'\n\n## How to interpret (informal)\n\nFirst the\
          \ \"atemporal\" FOL is derived from the OWL using the standard\ninterpretation.\
          \ This axiom is temporalized by embedding the axiom\nwithin a for-all-times\
          \ quantified sentence. The t argument is added to\nall instantiation predicates\
          \ and predicates that use this relation.\n\n## Example\n\n    Class: nucleus\n\
          \    SubClassOf: part_of some cell\n\n    forall t :\n      forall n :\n\
          \        instance_of(n,Nucleus,t)\n         implies\n        exists c :\n\
          \          instance_of(c,Cell,t)\n          part_of(n,c,t)\n\n## Notes\n\
          \nThis interpretation is *not* the same as an at-all-times relation\n\n"
        xrefs: []
    type: "INDIVIDUAL"
    lbl: "axiom holds for all times"
  - id: "http://purl.obolibrary.org/obo/BFO_0000040"
    meta:
